tables.table_schema:
CREATE TABLE QuantumComputingExperiments (
  experiment_id INT PRIMARY KEY,
  experiment_name VARCHAR(255),
  experiment_date TIMESTAMP,
  experiment_description TEXT
);

CREATE TABLE QuantumComputingData (
  experiment_id SERIAL PRIMARY KEY,
  experiment_name VARCHAR(100) NOT NULL,
  experiment_date DATE NOT NULL,
  qubit_count INT NOT NULL
);

CREATE TABLE QuantumComputingResults (
  result_id SERIAL PRIMARY KEY,
  experiment_id INT NOT NULL,
  result_data JSONB NOT NULL,
  result_timestamp TIMESTAMP
);

CREATE TABLE ExecutionLog (
  log_id SERIAL PRIMARY KEY,
  log_timestamp TIMESTAMP NOT NULL,
  log_message TEXT NOT NULL
);

CREATE TABLE ExperimentData (
    experiment_id INT PRIMARY KEY,
    experiment_name TEXT,
    start_time TIMESTAMP,
    end_time TIMESTAMP
);

CREATE TABLE experiments (
    experiment_id UUID PRIMARY KEY,
    experiment_name STRING,
    experiment_date TIMESTAMP,
    experiment_status STRING
);

CREATE TABLE quantum_devices (
    device_id UUID PRIMARY KEY,
    device_name STRING,
    device_type STRING,
    location STRING
);

CREATE TABLE experiment_data (
    data_id UUID PRIMARY KEY,
    experiment_id UUID REFERENCES experiments(experiment_id),
    device_id UUID REFERENCES quantum_devices(device_id),
    data_values JSONB
);

CREATE TABLE data_processing (
    processing_id UUID PRIMARY KEY,
    data_id UUID REFERENCES experiment_data(data_id),
    processing_date TIMESTAMP,
    processing_status STRING
);

CREATE TABLE visualization (
    visualization_id UUID PRIMARY KEY,
    data_id UUID REFERENCES experiment_data(data_id),
    visualization_type STRING,
    visualization_data JSONB
);
